import {Section} from 'bloomer';

export class Quotes extends Component {
  constructor(props) {
    super(props);
    this.state = { 
        items: [],
        isLoaded: false, 
    };
  }

  componentDidMount() {
      fetch('https://zenquotes.io/api/today')
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
